import React, { Component } from 'react'

class profile extends Component {
    render() {
        return (
            <div>
                <img src="https://cdn.pixabay.com/photo/2013/07/13/12/07/avatar-159236_960_720.png" alt="pic"></img>

            </div>
        )
    }
}
export default profile;
